const Notes = ({notes}) => {
  return(
    <div>
      {notes.map(note=>{
        return(
        <div>
          <p>{note.id}</p>
          <p>{note.title}</p>
          <p>{note.note}</p>
        </div>
        );
      }
      )}
    </div>
  );
}

export default Notes
